import React from 'react'

function Landing() {
    return (
        <div className="landing">
            <h1>Dobrodošli!</h1>
            <h3>Na našem sajtu možete pronaći najkvalitetniju odeću za svoje mališane.</h3>
            <button>Kategorije</button>
            <input type="text"></input>
        </div>
    )
}

export default Landing
